class Solution {
  int sumIndicesWithKSetBits(List<int> nums, int k) {
    int sum = 0;
    for (int i = 0; i < nums.length; i++) {
      // Count the set bits in the binary representation of the index
      int setBits = 0;
      int index = i;
      while (index > 0) {
        setBits += index & 1; // Increment setBits if the least significant bit is 1
        index >>= 1; // Right shift to check the next bit
      }
      // If the number of set bits equals k, add the corresponding number to sum
      if (setBits == k) {
        sum += nums[i];
      }
    }
    return sum;
  }
}
